import React from 'react';
import '../styles/Contact.css';

function Contact() {
  return (
    <section className="contact-section">
      <h1 className="contact-title">Contact</h1>
      <div className="contact-content">
        <form className="contact-form">
          <input type="text" placeholder="Your Name" required />
          <input type="email" placeholder="Your Email" required />
          <textarea placeholder="Your Message" rows={5} required />
          <button type="submit">Send</button>
        </form>
        <div className="contact-info">
          <h2>Get in touch</h2>
          <p>Email: <a href="mailto:your@email.com">your@email.com</a></p>
          <p>LinkedIn: <a href="https://linkedin.com/in/yourprofile" target="_blank" rel="noopener noreferrer">yourprofile</a></p>
          <p>GitHub: <a href="https://github.com/yourusername" target="_blank" rel="noopener noreferrer">yourusername</a></p>
        </div>
      </div>
    </section>
  );
}

export default Contact;
